import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import { Home, Browse, Signin, Signup } from './pages';


export default function App() {

  return ( 
    <Router>
      <Route exact path={Router.HOME}>
        <Home />
      </Route>
    </Router>
  );

}
